import React from "react";

const Card = props => (
  <div className="department-list">
    <li>
      <img src={props.logo} />
      <h3>{props.name}</h3>
    </li>
    <style jsx>{`
      .departments-list {
        display: grid;
        list-style-type: none;
        grid-template-columns: repeat(8, 1fr);
        padding: 0;
      }

      .departments-list li {
        display: flex;
        flex-direction: column;
      }
    `}</style>
  </div>
);

export default Card;
